    information. Our original solicitation includes a clear and conspicuous request
    for the contributor information and informs the contributor of the requirements
    of federal law to provide the information. If we do not receive the information
    we follow up within 30 days of receipt of the contribution by mail requesting
    only the missing information, informing the contributor of the requirements of
    federal law and including a pre-addressed return envelope. If we subsequently
    receive the contribution information we will file with our next regularly scheduled
    report an amended Schedule A listing all of the contributions for which additional
    information was received."
